[{"location":"endpoints/courses/#Courses-API","page":"Courses API","title":"Courses API","text":"","category":"section"},{"location":"endpoints/courses/","page":"Courses API","title":"Courses API","text":"This page documents the Courses API of Canvas, see https://canvas.instructure.com/doc/api/courses for details.","category":"page"},{"location":"endpoints/courses/","page":"Courses API","title":"Courses API","text":"Pages = [\"courses.md\"]","category":"page"},{"location":"endpoints/courses/","page":"Courses API","title":"Courses API","text":"","category":"page"},{"location":"endpoints/courses/","page":"Courses API","title":"Courses API","text":"Canvas.courses\nCanvas.course\nCanvas.create_course\nCanvas.update_course\nCanvas.settings\nCanvas.update_settings\nCanvas.delete_course\nCanvas.reset_content\nCanvas.users\nCanvas.user\nCanvas.recent_students\nCanvas.upload_file\nCanvas.content_share_users\nCanvas.preview_html\nCanvas.activity_stream\nCanvas.todo\nCanvas.effective_due_dates\nCanvas.permissions","category":"page"},{"location":"endpoints/courses/#Canvas.courses","page":"Courses API","title":"Canvas.courses","text":"Canvas.courses(; kwargs...) -> Vector{Course}, page_data\n\nReturn a paginated list of courses for the authenticated user. Return a vector of Courses and a dictionary with page data.\n\nCanvas API documentation: List your courses (GET /api/v1/courses)\n\n\n\n\n\nCanvas.courses(user::User; kwargs...) -> Vector{Course}, page_data\n\nReturn a paginated list of courses for the specified user. Return a vector of Courses and a dictionary with page data.\n\nCanvas API documentation: List courses for a user (GET /api/v1/users/:user_id/courses)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.course","page":"Courses API","title":"Canvas.course","text":"Canvas.course(course::Course; kwargs...) -> Course\n\nReturn details about a single course specified by id. Return a Course.\n\nCanvas API documentation: Get a single course (GET /api/v1/courses/:id)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.create_course","page":"Courses API","title":"Canvas.create_course","text":"Canvas.create_course(acc::Account; kwargs...) -> Course\n\nCreate a new course. Return a Course.\n\nCanvas API documentation: Create a new course (POST /api/v1/accounts/:account_id/courses)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.update_course","page":"Courses API","title":"Canvas.update_course","text":"Canvas.update_course(course::Course; kwargs...) -> Course\n\nUpdate an existing course and return the new details. Return a Course.\n\nCanvas API documentation: Update a course (PUT /api/v1/courses/:id)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.settings","page":"Courses API","title":"Canvas.settings","text":"Canvas.settings(course::Course; kwargs...) -> Dict\n\nReturn course settings as a dictionary.\n\nCanvas API documentation: Get course settings (GET /api/v1/courses/:course_id/settings)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.update_settings","page":"Courses API","title":"Canvas.update_settings","text":"Canvas.update_settings(course::Course; kwargs...) -> Dict\n\nUpdate course settings. Return a dictionary.\n\nCanvas API documentation: Update course settings (PUT /api/v1/courses/:course_id/settings)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.delete_course","page":"Courses API","title":"Canvas.delete_course","text":"Canvas.delete_course(course::Course; kwargs...) -> Dict\n\nDelete or conclude an existing course.\n\nCanvas API documentation: Delete/Conclude a course (DELETE /api/v1/courses/:id)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.reset_content","page":"Courses API","title":"Canvas.reset_content","text":"Canvas.reset_content(course::Course; kwargs...) -> Course\n\nDelete the course and create a new equivalent course with no content but all sections and users moved overs. Return a Course.\n\nCanvas API documentation: Reset a course (POST /api/v1/courses/:course_id/reset_content)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.users","page":"Courses API","title":"Canvas.users","text":"Canvas.users(course::Course; kwargs...) -> Vector{User}, page_data\n\nReturn a paginated list of users in the course. Return a vector of Users and a dictionary with page data.\n\nCanvas API documentation: List users in course (GET /api/v1/courses/:course_id/users)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.user","page":"Courses API","title":"Canvas.user","text":"Canvas.user(course::Course, user::User; kwargs...) -> User\n\nReturn information about a single user in the course. Return a User.\n\nCanvas API documentation: Get single user (GET /api/v1/courses/:course_id/users/:id)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.recent_students","page":"Courses API","title":"Canvas.recent_students","text":"Canvas.recent_students(course::Course; kwargs...) -> Vector{User}, page_data\n\nReturn a paginated list of users in the course ordered by how recently they have logged in. Return a vector of Users and a dictionary of page data.\n\nCanvas API documentation: List recently logged in students (GET /api/v1/courses/:course_id/recent_students)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.upload_file","page":"Courses API","title":"Canvas.upload_file","text":"Canvas.upload_file(c::Course, file::String; kwargs...) -> File\n\nUpload a file to the course. Return a File.\n\nCanvas API documentation: Upload a file to a course (POST /api/v1/courses/:course_id/files)\n\n\n\n\n\nCanvas.upload_file(f::Folder, file; kwargs...) -> File\n\nRequest endpoint: POST /api/v1/folders/:folder_id/files\n\nCanvas API documentation: Upload a file to a folder\n\n\n\n\n\nCanvas.upload_file(c::Course, a::Assignment, u::User, file; kwargs...) -> File\n\nRequest endpoint: POST /api/v1/courses/:course_id/assignments/:assignment_id/submissions/:user_id/comments/files\n\nCanvas API documentation: Upload a file\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.content_share_users","page":"Courses API","title":"Canvas.content_share_users","text":"Canvas.content_share_users(course::Course; kwargs...) -> Vector{User}, page_data\n\nReturn a paginated list of users you can share content with. Return a vector of Users and a dictionary of page data.\n\nCanvas API documentation: Search for content share users (GET /api/v1/courses/:course_id/content_share_users)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.preview_html","page":"Courses API","title":"Canvas.preview_html","text":"Canvas.preview_html(course::Course; kwargs...) -> Dict\n\nPreview HTML content processed for this course. Return a dictionary.\n\nCanvas API documentation: Preview processed html (POST /api/v1/courses/:course_id/preview_html)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.activity_stream","page":"Courses API","title":"Canvas.activity_stream","text":"Canvas.activity_stream(course::Course; summary::Bool=false, kwargs...) -> Vector{Dict}, page_data\n\nReturn the authenticated users course-specific activity stream paginated.\n\nRequest endpoints:\n\nGET /api/v1/courses/:course_id/activity_stream\nGET /api/v1/courses/:course_id/activity_stream/summary\n\nCanvas API documentation:\n\nCourse activity stream (GET /api/v1/courses/:course_id/activity_stream)\nCourse activity stream (GET /api/v1/courses/:course_id/activity_stream/summary)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.todo","page":"Courses API","title":"Canvas.todo","text":"Canvas.todo(course::Course; kwargs...) -> Vector{Dict}, page_data\n\nReturn the authenticated users course-specific todo items.\n\nCanvas API documentation: Course TODO items (GET /api/v1/courses/:course_id/todo)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.effective_due_dates","page":"Courses API","title":"Canvas.effective_due_dates","text":"Canvas.effective_due_dates(course::Course; kwargs...) -> Dict\n\nFor each assignment in the course, returns each assigned student's ID and their corresponding due date along with some grading period data.\n\nCanvas API documentation: Get effective due dates (GET /api/v1/courses/:course_id/effective_due_dates)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/courses/#Canvas.permissions","page":"Courses API","title":"Canvas.permissions","text":"Canvas.permissions(course::Course; kwargs...) -> Dict\n\nReturn permissions for the authenticated user in the specified course. Return a dictionary.\n\nCanvas API documentation: Permissions (GET /api/v1/courses/:course_id/permissions)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/assignments/#Assignments-API","page":"Assignments API","title":"Assignments API","text":"","category":"section"},{"location":"endpoints/assignments/","page":"Assignments API","title":"Assignments API","text":"This page documents the Assignments API of Canvas, see https://canvas.instructure.com/doc/api/assignments for details.","category":"page"},{"location":"endpoints/assignments/","page":"Assignments API","title":"Assignments API","text":"Pages = [\"assignments.md\"]","category":"page"},{"location":"endpoints/assignments/","page":"Assignments API","title":"Assignments API","text":"","category":"page"},{"location":"endpoints/assignments/","page":"Assignments API","title":"Assignments API","text":"Canvas.assignments\nCanvas.assignment\nCanvas.create_assignment\nCanvas.update_assignment\nCanvas.delete_assignment\nCanvas.assignment_overrides\nCanvas.assignment_override\nCanvas.create_assignment_override\nCanvas.update_assignment_override\nCanvas.delete_assignment_override","category":"page"},{"location":"endpoints/assignments/#Canvas.assignments","page":"Assignments API","title":"Canvas.assignments","text":"Canvas.assignments(c::Course; kwargs...) -> Vector{Assignment}, page_data\n\nReturn the paginated list of assignments for the course. Return a vector of Assignments and a dictionary with page data.\n\nCanvas API documentation: List assignments (GET /api/v1/courses/:course_id/assignments)\n\n\n\n\n\nCanvas.assignments(c::Course, a::AssignmentGroup; kwargs...) -> Vector{Assignment}, page_data\n\nReturn the paginated list of assignments for the course and assignment group. Return a vector of Assignments and a dictionary with page data.\n\nCanvas API documentation: List assignments (GET /api/v1/courses/:course_id/assignment_groups/:assignment_group_id/assignments)\n\n\n\n\n\nCanvas.assignments(u::User, c::Course; kwargs...) -> Vector{Assignment}, page_data\n\nReturn the paginated list of assignments for the specified user and course. Return a vector of Assignments and a dictionary with page data.\n\nCanvas API documentation: List assignments for user(GET /api/v1/users/:user_id/courses/:course_id/assignments)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/assignments/#Canvas.assignment","page":"Assignments API","title":"Canvas.assignment","text":"Canvas.assignment(c::Course, a::Assignment; kwargs...) -> Assignment\n\nReturn the assignment given by id. Return an Assignment.\n\nCanvas API documentation: Get a single assignment (GET /api/v1/courses/:course_id/assignments/:id)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/assignments/#Canvas.create_assignment","page":"Assignments API","title":"Canvas.create_assignment","text":"Canvas.create_assignment(c::Course, a::Assignment; kwargs...) -> Assignment\n\nCreate a new assignment for the course and return the details. Return an Assignment.\n\nCanvas API documentation: Create an assignment (POST /api/v1/courses/:course_id/assignments)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/assignments/#Canvas.update_assignment","page":"Assignments API","title":"Canvas.update_assignment","text":"Canvas.update_assignment(c::Course, a::Assignment; kwargs...) -> Assignment\n\nModify an existing assignment and return the new details. Return an Assignment.\n\nCanvas API documentation: Edit an assignment (PUT /api/v1/courses/:course_id/assignments/:id)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/assignments/#Canvas.delete_assignment","page":"Assignments API","title":"Canvas.delete_assignment","text":"Canvas.delete_assignment(c::Course, a::Assignment; kwargs...) -> Assignment\n\nDelete the given assignment and return the former details. Return an Assignment.\n\nCanvas API documentation: Delete an assignment (DELETE /api/v1/courses/:course_id/assignments/:id)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/assignments/#Canvas.assignment_overrides","page":"Assignments API","title":"Canvas.assignment_overrides","text":"Canvas.assignment_overrides(c::Course, a::Assignment; kwargs...) -> Vector{AssignmentOverride}, page_data\n\nReturn the paginated list of overrides for this course and assignment. Return a vector of AssignmentOverrides and a dictionary with page data.\n\nCanvas API documentation: List assignment overrides (GET /api/v1/courses/:course_id/assignments/:assignment_id/overrides)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/assignments/#Canvas.assignment_override","page":"Assignments API","title":"Canvas.assignment_override","text":"Canvas.assignment_override(c::Course, a::Assignment, o::AssignmentOverride; kwargs...) -> AssignmentOverride\n\nReturn the details of override specified by id. Return an AssignmentOverride.\n\nCanvas API documentation: Get a single assignment overrides (GET /api/v1/courses/:course_id/assignments/:assignment_id/overrides/:id)\n\n\n\n\n\nCanvas.assignment_override(co::Union{Group,Section}, a::Assignment; kwargs...) -> AssignmentOverride\n\nReturn the override for the given group or section associated with the assignment (404 otherwise). Return an AssignmentOverride.\n\nCanvas API documentation:\n\nRedirect to the assignment override for a group (GET /api/v1/groups/:group_id/assignments/:assignment_id/override)\nRedirect to the assignment override for a section (GET /api/v1/sections/:course_section_id/assignments/:assignment_id/override)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/assignments/#Canvas.create_assignment_override","page":"Assignments API","title":"Canvas.create_assignment_override","text":"Canvas.create_assignment_override(c::Course, a::Assignment; kwargs...) -> AssignmentOverride\n\nCreate an assignment override. One of student_ids, group_id or course_section_id must be present, see API specification for details. Return the AssignmentOverride.\n\nCanvas API documentation: Create an assignment override (POST /api/v1/courses/:course_id/assignments/:assignment_id/overrides)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/assignments/#Canvas.update_assignment_override","page":"Assignments API","title":"Canvas.update_assignment_override","text":"Canvas.update_assignment_override(c::Course, a::Assignment, o::AssignmentOverride; kwargs...) -> AssignmentOverride\n\nUpdate the assignment override. All current overriden values must be supplied if the should be retained, see API specification for details. Return the AssignmentOverride.\n\nCanvas API documentation: Update an assignment override (PUT /api/v1/courses/:course_id/assignments/:assignment_id/overrides/:id)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/assignments/#Canvas.delete_assignment_override","page":"Assignments API","title":"Canvas.delete_assignment_override","text":"Canvas.delete_assignment_override(c::Course, a::Assignment, o::AssignmentOverride; kwargs...) -> AssignmentOverride\n\nDelete and override and return the former details. Return an AssignmentOverride.\n\nCanvas API documentation: Update an assignment override (DELETE /api/v1/courses/:course_id/assignments/:assignment_id/overrides/:id)\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Files-API","page":"Files API","title":"Files API","text":"","category":"section"},{"location":"endpoints/files/","page":"Files API","title":"Files API","text":"This page documents the Files API of Canvas, see https://canvas.instructure.com/doc/api/files for details.","category":"page"},{"location":"endpoints/files/#Files-API-Index","page":"Files API","title":"Files API Index","text":"","category":"section"},{"location":"endpoints/files/","page":"Files API","title":"Files API","text":"Pages = [\"files.md\"]","category":"page"},{"location":"endpoints/files/","page":"Files API","title":"Files API","text":"Canvas.quota\nCanvas.files\nCanvas.public_url\nCanvas.file\nCanvas.update_file\nCanvas.delete_file\nCanvas.folders\nCanvas.resolve_path\nCanvas.folder\nCanvas.update_folder\nCanvas.create_folder\nCanvas.delete_folder\nCanvas.copy_file\nCanvas.copy_folder\nCanvas.media_folder\nCanvas.usage_rights\nCanvas.remove_usage_rights\nCanvas.licenses","category":"page"},{"location":"endpoints/files/#Canvas.quota","page":"Files API","title":"Canvas.quota","text":"Canvas.quota(co::Union{Course,Group,User}; kwargs...) -> Dict\n\nRequest endpoints:\n\nGET /api/v1/courses/:course_id/files/quota\nGET /api/v1/groups/:group_id/files/quota\nGET /api/v1/users/:user_id/files/quota\n\nCanvas API documentation: Get quota information\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.files","page":"Files API","title":"Canvas.files","text":"Canvas.files(co::Union{Course,Group,User}; kwargs...) -> Vector{File}, page_data\n\nRequest endpoints:\n\nGET /api/v1/courses/:course_id/files\nGET /api/v1/users/:user_id/files\nGET /api/v1/groups/:group_id/files\nGET /api/v1/folders/:id/files\n\nCanvas API documentation: List files\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.public_url","page":"Files API","title":"Canvas.public_url","text":"Canvas.public_url(f::File; kwargs...) -> Dict\n\nRequest endpoint: GET /api/v1/files/:id/public_url\n\nCanvas API documentation: Get public inline preview url\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.file","page":"Files API","title":"Canvas.file","text":"Canvas.file(f::File; kwargs...) -> File\n\nRequest endpoint: GET /api/v1/files/:id\n\nCanvas API documentation: Get file\n\n\n\n\n\nCanvas.file(co::Union{Course,Group,User}, f::File; kwargs...) -> File\n\n**Request endpoints:*\n\nGET /api/v1/courses/:course_id/files/:id\nGET /api/v1/groups/:group_id/files/:id\nGET /api/v1/users/:user_id/files/:id\n\nCanvas API documentation: Get file\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.update_file","page":"Files API","title":"Canvas.update_file","text":"Canvas.update_file(f::File; kwargs...) -> File\n\nRequest endpoint: PUT /api/v1/files/:id\n\nCanvas API documentation: Update file\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.delete_file","page":"Files API","title":"Canvas.delete_file","text":"Canvas.delete_file(f::File; kwargs...) -> File\n\nRequest endpoint: DELETE /api/v1/files/:id\n\nCanvas API documentation: Delete file\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.folders","page":"Files API","title":"Canvas.folders","text":"Canvas.folders(f::Folder; kwargs...) -> Vector{Folder}, page_data\n\nRequest endpoint: GET /api/v1/folders/:id/folders\n\nCanvas API documentation: List folders\n\n\n\n\n\nCanvas.folders(co::Union{Course,Group,User}; kwargs...) -> Vector{Folder}, page_data\n\nRequest endpoints:\n\nGET /api/v1/courses/:course_id/folders\nGET /api/v1/groups/:group_id/folders\nGET /api/v1/users/:user_id/folders\n\nCanvas API documentation: List all folders\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.resolve_path","page":"Files API","title":"Canvas.resolve_path","text":"Canvas.resolve_path(co::Union{Course,Group,User}, path=\"\"; kwargs...) -> Vector{Folder}, page_data\n\nRequest endpoints:\n\nGET /api/v1/courses/:course_id/folders/by_path\nGET /api/v1/groups/:group_id/folders/by_path\nGET /api/v1/users/:user_id/folders/by_path\n\nCanvas API documentation: Resolve path\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.folder","page":"Files API","title":"Canvas.folder","text":"Canvas.folder(f::Folder; kwargs...) -> Folder\n\nRequest endpoint: GET /api/v1/folders/:id\n\nCanvas API documentation: Get folder\n\n\n\n\n\nCanvas.folder(co::Union{Course,Group,User}, f::Folder; kwargs...) -> Folder\n\n**Request endpoints:*\n\nGET /api/v1/courses/:course_id/folders/:id\nGET /api/v1/groups/:group_id/folders/:id\nGET /api/v1/users/:user_id/folders/:id\n\nCanvas API documentation: Get folder\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.update_folder","page":"Files API","title":"Canvas.update_folder","text":"Canvas.update_folder(f::Folder; kwargs...) -> Folder\n\nRequest endpoint: PUT /api/v1/folders/:id\n\nCanvas API documentation: Update folder\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.create_folder","page":"Files API","title":"Canvas.create_folder","text":"Canvas.create_folder(co::Union{Course,Group,User,Folder}; kwargs...) -> Folder\n\n**Request endpoints:*\n\nPOST /api/v1/courses/:course_id/folders\nPOST /api/v1/groups/:group_id/folders\nPOST /api/v1/users/:user_id/folders\nPOST /api/v1/folders/:folder_id/folders\n\nCanvas API documentation: Create folder\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.delete_folder","page":"Files API","title":"Canvas.delete_folder","text":"Canvas.delete_folder(f::Folder; kwargs...) -> Dict\n\nRequest endpoint: DELETE /api/v1/folders/:id\n\nCanvas API documentation: Delete folder\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.copy_file","page":"Files API","title":"Canvas.copy_file","text":"Canvas.copy_file(f::Folder; kwargs...) -> File\n\nRequest endpoint: POST /api/v1/folders/:dest_folder_id/copy_file\n\nCanvas API documentation: Copy a file\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.copy_folder","page":"Files API","title":"Canvas.copy_folder","text":"Canvas.copy_folder(f::Folder; kwargs...) -> Folder\n\nRequest endpoint: POST /api/v1/folders/:dest_folder_id/copy_folder\n\nCanvas API documentation: Copy a folder\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.media_folder","page":"Files API","title":"Canvas.media_folder","text":"Canvas.media_folder(co::Union{Course,Group}; kwargs...) -> Folder\n\n**Request endpoints:*\n\nGET /api/v1/courses/:course_id/folders/media\nGET /api/v1/groups/:group_id/folders/media\n\nCanvas API documentation: Get uploaded media folder for user\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.usage_rights","page":"Files API","title":"Canvas.usage_rights","text":"Canvas.usage_rights(co::Union{Course,Group,User}; kwargs...) -> UsageRights\n\n**Request endpoints:*\n\nPUT /api/v1/courses/:course_id/usage_rights\nPUT /api/v1/groups/:group_id/usage_rights\nPUT /api/v1/users/:user_id/usage_rights\n\nCanvas API documentation: Set usage rights\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.remove_usage_rights","page":"Files API","title":"Canvas.remove_usage_rights","text":"Canvas.remove_usage_rights(co::Union{Course,Group,User}; kwargs...) -> Dict\n\n**Request endpoints:*\n\nDELETE /api/v1/courses/:course_id/usage_rights\nDELETE /api/v1/groups/:group_id/usage_rights\nDELETE /api/v1/users/:user_id/usage_rights\n\nCanvas API documentation: Remove usage rights\n\n\n\n\n\n","category":"function"},{"location":"endpoints/files/#Canvas.licenses","page":"Files API","title":"Canvas.licenses","text":"Canvas.licenses(co::Union{Course,Group,User}; kwargs...) -> Vector{License}, page_data\n\n**Request endpoints:*\n\nGET /api/v1/courses/:course_id/content_licenses\nGET /api/v1/groups/:group_id/content_licenses\nGET /api/v1/users/:user_id/content_licenses\n\nCanvas API documentation: List licenses\n\n\n\n\n\n","category":"function"},{"location":"#**1.**-Introduction","page":"1. Introduction","title":"1. Introduction","text":"","category":"section"},{"location":"","page":"1. Introduction","title":"1. Introduction","text":"Welcome to the documentation for Canvas.jl – a Julia interface to the Canvas LMS","category":"page"}]
